def solve():
    s = "t2 t13 t1 t1 t3 t16 t6 t14 t12 t15 t11 t15 t10 t1 t7 t11 t11 t2 t16 t0 t16 t12 t14 t1 t8 t1"

    n = len(s)
    if n == 0:
        print("Yes")
        return

    dp = [False] * (n + 1)
    dp[0] = True

    for i in range(1, n + 1):
        for j in range(i):
            if dp[j] and s[j:i] in "t2t13t1":
                dp[i] = True
                break

    if dp[n]:
        print("Yes")
    else:
        print("No")

solve()
```

